  console.log(data)

  const listDolls = data.map((doll) => 
    <BodyForm 
      key={uuid()}
      data={doll}
    />
  )

  return(
    <div>
      <Table celled>
        <HeaderForm />
        {/* {listDolls} */}
      </Table>
    </div>
  )
}

export default TableForm
